import React, { useState, useEffect } from 'react';

function CustomerReviews() {
  // Theme colors
  const themeRed = '#e74c3c';
  const themeYellow = '#f39c12';
  const themeGreen = '#27ae60';
  const themeWhite = '#ecf0f1';
  const themeText = '#2c3e50';

  // Apply theme colors as CSS variables
  useEffect(() => {
    document.documentElement.style.setProperty('--theme-red', themeRed);
    document.documentElement.style.setProperty('--theme-yellow', themeYellow);
    document.documentElement.style.setProperty('--theme-green', themeGreen);
    document.documentElement.style.setProperty('--theme-white', themeWhite);
    document.documentElement.style.setProperty('--theme-text', themeText);
  }, []);

  const [reviews, setReviews] = useState([]);
  const [reviewText, setReviewText] = useState("");
  const [rating, setRating] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    if (reviewText && rating) {
      const newReview = { text: reviewText, rating };
      setReviews([...reviews, newReview]);
      setReviewText("");
      setRating("");
    }
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial", backgroundColor: themeWhite, borderRadius: "8px", maxWidth: "800px", margin: "2rem auto", border: `1px solid ${themeText}` }}>
      <h3 style={{ color: themeText, textAlign: "center", marginBottom: "1.5rem" }}>⭐ My Reviews</h3>
      <p style={{ color: themeText }}>Submit your feedback for completed bookings below.</p>

      {/* Review Form */}
      <form onSubmit={handleSubmit} style={{ marginBottom: "20px" }}>
        <textarea
          value={reviewText}
          onChange={(e) => setReviewText(e.target.value)}
          placeholder="Write your review..."
          rows="4"
          style={{
            width: "100%",
            padding: "10px",
            marginBottom: "10px",
            border: `1px solid ${themeText}`,
            borderRadius: "5px",
            color: themeText,
          }}
        ></textarea>

        <select
          value={rating}
          onChange={(e) => setRating(e.target.value)}
          style={{
            padding: "8px",
            marginBottom: "10px",
            border: `1px solid ${themeText}`,
            borderRadius: "5px",
            display: "block",
            color: themeText,
          }}
        >
          <option value="">Select Rating</option>
          <option value="⭐">⭐</option>
          <option value="⭐⭐">⭐⭐</option>
          <option value="⭐⭐⭐">⭐⭐⭐</option>
          <option value="⭐⭐⭐⭐">⭐⭐⭐⭐</option>
          <option value="⭐⭐⭐⭐⭐">⭐⭐⭐⭐⭐</option>
        </select>

        <button
          type="submit"
          style={{
            padding: "10px 20px",
            backgroundColor: themeGreen,
            color: themeWhite,
            border: "none",
            borderRadius: "5px",
            cursor: "pointer",
          }}
        >
          Submit Review
        </button>
      </form>

      {/* Display Submitted Reviews */}
      <div>
        <h4 style={{ color: themeText }}>My Submitted Reviews</h4>
        {reviews.length === 0 ? (
          <p>No reviews yet.</p>
        ) : (
          reviews.map((r, index) => (
            <div
              key={index}
              style={{
                border: `1px solid ${themeYellow}`,
                borderRadius: "5px",
                padding: "10px",
                marginBottom: "10px",
                backgroundColor: themeWhite,
              }}
            >
              <p style={{ margin: "5px 0" }}>{r.text}</p>
              <p style={{ margin: "5px 0", fontWeight: "bold" }}>
                Rating: {r.rating}
              </p>
            </div>
          ))
        )}
      </div>
    </div>
  );
}

export default CustomerReviews;
